.goog-menu {
  background: #fff;
  border-color: #ccc #666 #666 #ccc;
  border-style: solid;
  border-width: 1px;
  cursor: default;
  font: normal 13px Arial, sans-serif;
  margin: 0;
  outline: none;
  padding: 4px 0;
  position: absolute;
  z-index: 20000;
}

.goog-menuitem {
  color: #000;
  font: normal 13px Arial, sans-serif;
  list-style: none;
  margin: 0;
  padding: 4px 7em 4px 28px;
  white-space: nowrap
}

.goog-menuitem.goog-menuitem-rtl {
  padding-left: 7em;
  padding-right: 28px
}

.goog-menu-nocheckbox .goog-menuitem,
.goog-menu-noicon .goog-menuitem {
  padding-left: 12px
}

.goog-menu-noaccel .goog-menuitem {
  padding-right: 20px
}

.goog-menuitem-content {
  color: #000;
  font: normal 13px Arial, sans-serif
}

.goog-menuitem-disabled .goog-menuitem-accel,
.goog-menuitem-disabled .goog-menuitem-content {
  color: #ccc !important
}

.goog-menuitem-disabled .goog-menuitem-icon {
  opacity: 0.3;
  -moz-opacity: 0.3;
  filter: alpha(opacity = 30)
}

.goog-menuitem-highlight,
.goog-menuitem-hover {
  background-color: #d6e9f8;
  border-color: #d6e9f8;
  border-style: dotted;
  border-width: 1px 0;
  padding-bottom: 3px;
  padding-top: 3px
}

.goog-menuitem-checkbox,
.goog-menuitem-icon {
  background-repeat: no-repeat;
  height: 16px;
  left: 6px;
  position: absolute;
  right: auto;
  vertical-align: middle;
  width: 16px
}

.goog-menuitem-rtl .goog-menuitem-checkbox,
.goog-menuitem-rtl .goog-menuitem-icon {
  left: auto;
  right: 6px
}

.goog-option-selected .goog-menuitem-checkbox,
.goog-option-selected .goog-menuitem-icon {
  background:
    url('//ssl.gstatic.com/editor/editortoolbar.png') no-repeat -512px 0
}

.goog-menuitem-accel {
  color: #999;
  direction: ltr;
  left: auto;
  padding: 0 6px;
  position: absolute;
  right: 0;
  text-align: right
}

.goog-menuitem-rtl .goog-menuitem-accel {
  left: 0;
  right: auto;
  text-align: left
}

.goog-menuitem-mnemonic-hint {
  text-decoration: underline
}

.goog-menuitem-mnemonic-separator {
  color: #999;
  font-size: 12px;
  padding-left: 4px
}

.goog-menuseparator {
  border-top: 1px solid #ccc;
  margin: 4px 0;
  padding: 0
}

.goog-combobox {
  background: #ddd repeat-x scroll left top
    url('//ssl.gstatic.com/closure/button-bg.gif');
  border: 1px solid #b5b6b5;
  font: normal small arial, sans-serif
}

.goog-combobox input {
  background-color: #fff;
  border: 0;
  border-right: 1px solid #b5b6b5;
  color: #000;
  font: normal small arial, sans-serif;
  margin: 0;
  padding: 0 0 0 2px;
  vertical-align: bottom;
  width: 200px
}

.goog-combobox input.label-input-label {
  background-color: #fff;
  color: #aaa
}

.goog-combobox .goog-menu {
  margin-top: -1px;
  width: auto;
  z-index: 1000
}

.goog-combobox-button {
  cursor: pointer;
  display: inline-block;
  font-size: 10px;
  text-align: center;
  width: 16px
}

* html .goog-combobox-button {
  padding: 0 3px
}

.goog-inline-block {
  position: relative;
  display: -moz-inline-box;
  display: inline-block
}

* html .goog-inline-block {
  display: inline
}

*:first-child+html .goog-inline-block {
  display: inline
}

.goog-menu-button {
  background: #ddd repeat-x top left
    url('//ssl.gstatic.com/editor/button-bg.png');
  border: 0;
  color: #000;
  cursor: pointer;
  list-style: none;
  margin: 2px;
  outline: none;
  padding: 0;
  text-decoration: none;
  vertical-align: middle
}

.goog-menu-button-outer-box,
.goog-menu-button-inner-box {
  border-style: solid;
  border-color: #aaa;
  vertical-align: top
}

.goog-menu-button-outer-box {
  margin: 0;
  border-width: 1px 0;
  padding: 0
}

.goog-menu-button-inner-box {
  margin: 0 -1px;
  border-width: 0 1px;
  padding: 3px 4px
}

* html .goog-menu-button-inner-box {
  left: -1px
}

* html .goog-menu-button-rtl .goog-menu-button-outer-box {
  left: -1px;
  right: auto
}

* html .goog-menu-button-rtl .goog-menu-button-inner-box {
  right: auto
}

*:first-child+html .goog-menu-button-inner-box {
  left: -1px
}

*:first-child+html .goog-menu-button-rtl .goog-menu-button-inner-box {
  left: 1px;
  right: auto
}

::root .goog-menu-button,
::root .goog-menu-button-outer-box,
::root .goog-menu-button-inner-box {
  line-height: 0
}

::root .goog-menu-button-caption,
::root .goog-menu-button-dropdown {
  line-height: normal
}

.goog-menu-button-disabled {
  background-image: none !important;
  opacity: 0.3;
  -moz-opacity: 0.3;
  filter: alpha(opacity = 30)
}

.goog-menu-button-disabled .goog-menu-button-outer-box,
.goog-menu-button-disabled .goog-menu-button-inner-box,
.goog-menu-button-disabled .goog-menu-button-caption,
.goog-menu-button-disabled .goog-menu-button-dropdown {
  color: #333 !important;
  border-color: #999 !important
}

* html .goog-menu-button-disabled {
  margin: 2px 1px !important;
  padding: 0 1px !important
}

*:first-child+html .goog-menu-button-disabled {
  margin: 2px 1px !important;
  padding: 0 1px !important
}

.goog-menu-button-hover .goog-menu-button-outer-box,
.goog-menu-button-hover .goog-menu-button-in... [truncated]

